from jobs import q, update_job_status, return_job, rdimport matplotlib.pyplot as pltimport json@q.workerdef working(jid):    update_job_status(jid, "In Progress")    data = return_job(jid)        graph_data = json.loads(rd.get("Stocks"))[data['ticker']]    x_values = graph_data.keys()    y_values = graph_data.values()        plt.plot(x_values, y_values)    plt.savefig('output_img.png')            with open('output_img.png', encoding="utf8", errors='ignore') as f:        img = f.read()    rd.hset('job.{}'.format(jid), 'image', img)    rd.hset('job.{}'.format(jid), 'status', 'finished')    working()